export const Wrapper = styled.header`
  display: grid;

  width: 100vw;
  height: 50vh;
`

export const Content = styled.div`
  position: relative;

  width: 80vw;
  max-width: 1140px;

  justify-self: center;

  display: grid;

  @media (max-width: 800px) {
  }
`

export const Title = styled.h1``
export const SubTitle = styled.p``
